import React from "react";
import {Card} from "antd";
import "./main.scss"

const ItemCard = ({item}) => {
    const {name, gender} = item
    return  <div className="rootCard">
        <Card
            hoverable
            className="card"
            title={name}
        >
            <b>Gender:</b> {gender}
        </Card>
    </div>
};
export default ItemCard;
